import { REQUEST_POKEMONS, REQUEST_POKEMONS_BY_ID, REQUEST_POKEMONS_BY_NAME, REQUES_PRUEBA } from "../actions";

let initialState = {
    pokemons: [],
    types: [],
    prueba: ["no ha cambiado la prueba"],
    prueba2: {obj1 :{name:"mario", lastname:"vidal"}, obj2: {name:"cari", lastname:"aponte"}},
    prueba3: [{name: "mario", LastName: "vidal"}, {name:"Cari", lastname: "Aponte"}]
}

export default function reducer(state = initialState, action) {
    switch(action.type) {
        case REQUEST_POKEMONS:
            return {
                ...state,
                pokemons: action.payload.data
            }
        case REQUEST_POKEMONS_BY_ID: 
            return {
                ...state,
                pokemons: action.payload.data
            }
        case REQUEST_POKEMONS_BY_NAME:
            return {
                ...state,
                pokemons: action.payload.data
            }
        case REQUESt_PRUEBA:
            return {
                ...state,
                prueba: ["cambio la prueba"]
            }
        
        default: {
            return state
        }
    }
}
